{
  "database": "video_game_store",
  "collection": "Digital Analytics",
  "pipeline": [
    {
      "$match": {
        "Website Page": { "$regex": "Product Page", "$options": "i" },
        "Page Views": { "$gt": 2000 },
        "Unique Visitors": { "$lt": 200 },
        "Bounce Rate (%)": { "$lt": 25 },
        "Date": { "$lte": { "$date": "2024-12-31T23:59:59Z" } }
      }
    },
    {
      "$group": {
        "_id": null,
        "avgBounce": { "$avg": "$Bounce Rate (%)" },
        "avgConversion": { "$avg": "$Conversion Rate (%)" }
      }
    },
    {
      "$addFields": {
        "percentageDifference": {
          "$multiply": [
            {
              "$divide": [
                {
                  "$abs": {
                    "$subtract": [ "$avgBounce", "$avgConversion" ]
                  }
                },
                {
                  "$divide": [
                    { "$add": [ "$avgBounce", "$avgConversion" ] },
                    2
                  ]
                }
              ]
            },
            100
          ]
        }
      }
    },
    {
      "$lookup": {
        "from": "Digital Analytics",
        "let": { "targetPct": "$percentageDifference" },
        "pipeline": [
          {
            "$match": {
              "Website Page": { "$regex": "Product Page", "$options": "i" },
              "Page Views": { "$gt": 2000 },
              "Unique Visitors": { "$lt": 200 },
              "Bounce Rate (%)": { "$lt": 25 },
              "Date": { "$lte": { "$date": "2024-12-31T23:59:59Z" } }
            }
          },
          {
            "$addFields": {
              "sumUVASD": {
                "$add": [ "$Unique Visitors", "$Average Session Duration (Seconds)" ]
              }
            }
          },
          {
            "$addFields": {
              "diff": {
                "$abs": {
                  "$subtract": [ "$sumUVASD", "$$targetPct" ]
                }
              }
            }
          },
          { "$sort": { "diff": 1 } },
          { "$limit": 1 },
          {
            "$project": {
              "_id": 0,
              "Date": 1,
              "Page Views": 1,
              "Unique Visitors": 1,
              "Average Session Duration (Seconds)": 1,
              "sumUVASD": 1,
              "diff": 1
            }
          }
        ],
        "as": "closest"
      }
    },
    { "$unwind": { "path": "$closest", "preserveNullAndEmptyArrays": true } },
    {
      "$project": {
        "_id": 0,
        "avgBounce": 1,
        "avgConversion": 1,
        "percentageDifference": 1,
        "closest.Date": 1,
        "closest.Page Views": 1,
        "closest.Unique Visitors": 1,
        "closest.Average Session Duration (Seconds)": 1,
        "closest.sumUVASD": 1,
        "closest.diff": 1
      }
    }
  ]
}

